import ItemStyles from './styles/ItemStyles';

const Product = ({ product }) => {
  console.log(product);
  return (
    <ItemStyles>
      <img src={product.photo.image.publicUrlTransformed} alt={product.name} />
    </ItemStyles>
  );
};

export default Product;
